      var pagination = "<{0} class=\"actions {1}\"><ul role=\"menu\" aria-label=\"{2}\">{3}</ul></{0}>",
          buttonTemplate = "<li><a href=\"#{0}\" role=\"menuitem\" class=\"{2}\"\ title=\"{3}\">{1}</a></li>",
          buttons = "";

