      {
        buttons += buttonTemplate.format("previous", options.labels.previous,'btn btn-white', options.previousTooltip);
      }

      buttons += buttonTemplate.format("next", options.labels.next,'btn btn-primary', options.nextTooltip);

      if (options.enableFinishButton)
      {
        buttons += buttonTemplate.format("finish", options.labels.finish,'btn btn-primary', options.finishTooltip);
      }

      if (options.enableCancelButton)
      {
        buttons += buttonTemplate.format("cancel", options.labels.cancel,'btn btn-white', options.cancelTooltip);
      }

      wizard.append(pagination.format(options.actionContainerTag, options.clearFixCssClass,
                                      options.labels.pagination, buttons));

      refreshPagination(wizard, options, state);
